import styled from 'styled-components'

const StyledButton  = styled.button `
  border:1px solid #4caf50;
  background-color: ${props => props.variant === 'outline'};
  color: #fff;
  padding: 15px 32px;
  display:inline-block;
  font-size:16px;
  cursor: pointer;
  font-weight:600;
`
